import React, { } from 'react'
import { Form } from 'react-bootstrap'
import './styles.scss'

function AddImages() {

    return (
        <div id="add-images">
            <h1>Imagens</h1>

            <Form>
                {['checkbox', 'radio'].map((type) => (
                    <div key={`inline-${type}`} className="mb-3">
                        <Form.Check
                            inline
                            label="1"
                            name="group1"
                            type={type}
                            id={`inline-${type}-1`}
                        />
                        <Form.Check
                            inline
                            label="2"
                            name="group1"
                            type={type}
                            id={`inline-${type}-2`}
                        />
                        <Form.Check
                            inline
                            disabled
                            label="3 (disabled)"
                            type={type}
                            id={`inline-${type}-3`}
                        />
                    </div>
                ))
                }
            </Form >
        </div>
    )
}

export default AddImages
